gmd:dataQualityInfo.gmd:DQ_DataQuality.gmd:lineage.gmd:LI_Lineage.gmd:statement.gco:CharacterString.#text:§Donnée vectorielle créée à partir de l'interprétation de cartes d'Etat-Major, photographies aériennes et orthophotographies.
Les documents utilisés sont :
 - Cartes d'Etat-Major au 1/40000 (IGN) 1855, 1860 et 1861 ;
 - Cartes topographiques au 1/20000 (IGN) 1933, 1934, 1936 et 1947 ;
 - Photographies aériennes (IGN, SHOM, CRIGE-PACA) 1927, 1947 et 1949 ;
 - Orthophotographies (CRIGE-PACA) 2009.

Les zones créées ont été caractérisées suivant la nomenclature LCZ (Local Climatic Zones). Cette nomenclature, découpée en 17 classes, a été proposée par les climatologues I. D. STEWART  et T. R. OKE afin d'étudier et d'homogénéiser les mesures sur les ilôts de chaleur urbains dans le monde.
Ces classes sont réparties en deux catégories (les "types bâtis" et les "couvertures de sol"), et permettent de caractériser les objets urbains ayant une influence sur les températures.

Seule une "bande littorale", d'un kilomètre de part et d'autre du trait de côte de 1830, a été digitalisée.

